    return(
        <div className="Person" style={style}>
            <p onClick={Persn.click}>I'm a { Persn.name } and I am { Persn.age } years old !</p>
            <p>{Persn.children}</p>
            <input type="text" onChange={Persn.changed} value={Persn.name}  />
        </div>
    ) 
}

